import { FormEvent, useState } from "react";
import { useHistory } from "react-router";
import { Barrinha } from "../../components/sidebar";
import api from "../../services/api";

const useStyles = makeStyles((theme: Theme) =>
  createStyles({
    root: {
      flexGrow: 1,
    },
    paper: {
      padding: theme.spacing(24),
      textAlign: "center",
      color: theme.palette.text.secondary,
    },
  })
);

function Projects() {
  const classes = useStyles();
  // O userState guarda váriaveis dinamicamente
  const [nome, setNome] = useState("");
  // variavel auxiliar que funciona como histório de navegação
  const history = useHistory();
  const projects = async (e: FormEvent) => {
    e.preventDefault();

    // pegar a hora atual
    // const time = new Date();
    // const data = {
    //   nome,
    //   time,
    // };
    // console.log(data);

    // POST QUANDO MINHA API ESTIVER ONLINE
    // SE TEM BARRINHA NO BACK TEM BNARRINHA NO FRONT
    const response = await api
      .get("/projects/")
      // depois que rodar o post, roda o then
      // CASO SUCESSO
      .then(() => {
        alert("Cadastrado com sucesso");

        // como eu nao sei se ele acessou a pagina home, estou forçando
        // ele ir pra home
        history.push("/");
      })
      // CASO ERRO
      .catch(() => {
        alert("Serviço já existente");
      });
  };

  return (
    <>
      <Barrinha />
      {/* <Footer /> */}
    </>
  );
}

export default Projects;
